const Signin = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    errormsg: false,
    loading: false,
    redirectToDashboard: false,
  });

  const { email, password, errormsg, loading, redirectToDashboard } = formData;

  return <p>inside Signin Components</p>;
};
export default Signin;
